    def OK(self):
        if not(len(self.lineEdit.text())==4) or not(self.lineEdit.text().isdigit()) :
            self.showDialog("code invalide! Il doit contient uniquement 4 chiffre")
        else :
            if self.isimm.recherche_code(self.lineEdit.text())!=-1:
                k=self.isimm.recherche_code(self.lineEdit.text()) 
                t=self.lineEdit_2.text()
                if self.radioButton_2.isChecked():        
                    if len(t)==0 or not(t.isalpha()):
                        self.showDialog("Nom invalide!")
                    else :
                        self.isimm.liste_matiere[k].designation=t
                        self.showSuccess("La modification a effectu ")
                elif self.radioButton.isChecked():
                    if len(t)==0 or not(t.isdigit()):
                        self.showDialog("Coefficient invalide!")
                    else :
                        self.isimm.liste_matiere[k].coeff=t
                        self.showSuccess("La modification a effectu ")
            else :
                self.showDialog("la matire n'existe pas!")
        

